import Button from "react-bootstrap/Button";

import Card from "react-bootstrap/Card";
import Form from "react-bootstrap/Form";
import Alert from "react-bootstrap/Alert";
import { Stack } from "react-bootstrap";
import { Table } from "react-bootstrap";
import { Row } from "react-bootstrap";
import { Col } from "react-bootstrap";

function ShelterBooking() {
  const styles = {
    tbl: {
      width: "40vw",
    },
  };
  return (
    <>
      <div style={{ margin: "auto", width: "50%" }} className="mt-5 mb-5">
        <Card style={{ width: "40rem" }}>
          <Alert>
            <Alert.Heading className="d-flex justify-content-center">
              BED BOOKING
            </Alert.Heading>
            <div className="d-flex justify-content-end pt-3">
              Victim Id:1212
            </div>
          </Alert>

          <Form className="mt-1 p-3">
            <Row>
              <Col sm={6}>
                <Card.Img
                  style={styles.cardImg}
                  src={require("../../images/rescue.png")}
                />
              </Col>

              <Col sm={6}>
                <div>
                  <Form className="mt-1 p-3">
                    <div>
                      <b>Address :</b> 45456{" "}
                    </div>
                    <div>
                      <b>Contact Details:</b> Nit Road,Silchar
                    </div>
                  </Form>
                </div>
              </Col>
            </Row>
            <br />
            <Row>
              <Col sm={8}>
                <Form.Group as={Row}>
                  <Form.Label column sm={2}>
                    <div>
                      <b>Date:</b>
                    </div>
                    <b> </b>
                  </Form.Label>{" "}
                  <Col sm={10}>
                    <input
                      type="date"
                      //   ref={ref}
                      //   onChange={(e) => console.log(e.target.value)}
                      //   onFocus={() => (ref.current.type = "date")}
                      //   onBlur={() => (ref.current.type = "date")}
                    />
                  </Col>{" "}
                </Form.Group>
              </Col>
              <Col sm={4}></Col>
            </Row>
            <div>
              <b>Victim Details:</b>
            </div>
            <Form className="p-3">
              <Table bordered>
                <tbody>
                  <tr>
                    <td>Rani Singh</td>
                    <td>23</td>
                    <td>Female</td>
                    <td>Adult</td>
                  </tr>
                  <tr>
                    <td>Rani Singh</td>
                    <td>23</td>
                    <td>Female</td>
                    <td>Adult</td>
                  </tr>
                </tbody>
                <div className=" mt-3">
                  <Button variant="primary" size="sm" type="submit">
                    + Add Members
                  </Button>
                </div>
              </Table>
            </Form>

            <div className="d-flex justify-content-center mt-5">
              <Button onClick={() => {
                    navigate("/FoodMedReceipt");
                  }}
               variant="primary" size="sm" type="submit">
                Submit
              </Button>
            </div>
          </Form>
        </Card>
      </div>
    </>
  );
}

export default ShelterBooking;
